import React from "react";
import ExperienceItem from "./ExperienceItem";

const Experience = () => {
  const experiences = [
    {
      title: "Senior Frontend Developer",
      company: "Tech Solutions Inc.",
      period: "2022 - Present",
      responsibilities: [
        "Led the development of the company's flagship web application",
        "Implemented modern React practices including hooks and context API",
        "Mentored junior developers and established coding standards",
      ],
    },
    {
      title: "Web Developer",
      company: "Digital Creations",
      period: "2019 - 2022",
      responsibilities: [
        "Developed responsive websites for various clients across industries",
        "Collaborated with designers to implement pixel-perfect UI components",
        "Optimized website performance and improved load times by 40%",
      ],
    },
    {
      title: "Junior Developer",
      company: "WebStart Agency",
      period: "2017 - 2019",
      responsibilities: [
        "Assisted in the development of client websites using HTML, CSS, and JavaScript",
        "Performed bug fixes and implemented new features for existing projects",
        "Participated in weekly code reviews and team training sessions",
      ],
    },
  ];

  return (
    <div>
      <h2 className="text-3xl font-bold mb-6">Work Experience</h2>
      {experiences.map((experience, index) => (
        <ExperienceItem
          key={index}
          experience={experience}
          isLast={index === experiences.length - 1}
        />
      ))}
    </div>
  );
};

export default Experience;
